{'Name': 'src/algorithms/math/fast-exponentiation/modularExponent.js', 'Line Additions': 23, 'Line Deletions': 0, 'Patch': '@@ -0,0 +1,23 @@
+/**
+ * @param {number} base
+ * @param {number} exponent
+ * @param {number} m
+ * @return {number}
+ */
+
+export default function modularExponent(base, exponent, m) {
+  let x = base;
+  let y = exponent;
+  let res = 1;
+  const p = m;
+
+  x %= p;
+
+  while (y > 0) {
+    if (y & 1) res = (res * x) % p;
+    y >>= 1;
+    x = (x * x) % p;
+  }
+
+  return res;
+}'}

{'Name': 'src/algorithms/math/nth-root/nthRoot.js', 'Line Additions': 32, 'Line Deletions': 0, 'Patch': '@@ -0,0 +1,32 @@
+/**
+ * @param {number} num
+ * @param {number} power
+ * @return {number}
+ */
+
+export default function nthRoot(num, power) {
+  const E = 0.000000001;
+  const roundToMargin = (x) => {
+    return Math.round(x / E) * E;
+  };
+
+  let guess;
+  const calculateError = () => Math.abs(num - (guess ** power));
+
+  let start = 0;
+  let end = num;
+  let error = 1;
+
+  while (error > E) {
+    guess = (start + end) / 2;
+    error = calculateError();
+
+    if (guess ** power > num) {
+      end = guess;
+    } else {
+      start = guess;
+    }
+  }
+
+  return roundToMargin(guess);
+}'}

