{'Name': 'src/algorithms/string/levenshtein-distance/levenshteinDistance.js', 'Line Additions': 17, 'Line Deletions': 0, 'Patch': '@@ -35,3 +35,20 @@ export default function levenshteinDistance(a, b) {

